        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "calculated"
    },
    "fair_perc_self_calc": {
      "description": "Calculated percentage share considered fair for the participant based on token contributions. If sum_tokens is 0, fair share is 50%.",
